import React from 'react';

class Spinner extends React.Component {
    render(){
        return (
        <div class="d-flex justify-content-center">
            <div class="spinner-border" role="status">
              <span class="visually-hidden">Loading...</span>
            </div>
          </div>
        )    
}
}

export default Spinner;
